SET search_path TO public;

DO
$$
    DECLARE
        saved_uuid UUID;
    BEGIN
        WITH company_insert AS (
            INSERT INTO companies (name, tax_id_number, duns, ach_company_id, industry, logo)
                VALUES ('Elemental Resources Inc.', 459876543, 123456789, 459876543, 'basic materials', 'data:image/webp;base64,')
                RETURNING company_id
        )
        SELECT company_id INTO saved_uuid FROM company_insert;

        INSERT INTO company_addresses (company_id, address_line_1, city, state, zip_code)
        VALUES (saved_uuid, '123 Mineral Lane', 'Boulder', 'CO', 80301);

        INSERT INTO company_phones (company_id, phone_number)
        VALUES (saved_uuid, '7192662837');
    END
$$;
